import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import CreateArea from "./CreateArea";

function App() {
  return (
    <Router>
      <div className="container">
        <Switch>
          <Route path="/" exact component={CreateArea}></Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;

